// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract MetaPassport is ERC721, Pausable, AccessControl, ERC721Burnable {
    using Counters for Counters.Counter;

    bytes32 public constant PAUSER_ROLE = keccak256("PAUSER_ROLE");
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    Counters.Counter private _tokenIdCounter;
    string public tokenURIPrefix = "";
    address public avatarPartAddress;
    address public avatarSetAddress;
    uint public partTypeCnt = 0x4;

    // Mapping owner address to the unique metapassport token ID
    mapping(address => uint256) private _owned;

    // Mapping metapassport bind avatars
    mapping(uint256 => mapping(uint256 => bool)) private _bindAvatarsMapping; 
    mapping(uint256 => uint256[]) private _bindAvatarsArray; 

    // Mapping mpTokenId current selected bind avatar
    // mpTokenId => (part type => part num)
    mapping(uint256 => mapping(uint => uint)) private _selectedAvatar;

    // events
    event MetaPassportMint(address to, uint256 tokenId);
    event BindAvatarPart(uint256 mpTokenId, uint256 avatarPartId);
    event SetCurrentAvatarPart(uint256 mpTokenId, uint[] avatarPartIds);

    constructor() ERC721("MetaPassport", "MP") {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(PAUSER_ROLE, msg.sender);
        _grantRole(MINTER_ROLE, msg.sender);
        _tokenIdCounter.increment(); // tokenId start from 1
    }

    function pause() public onlyRole(PAUSER_ROLE) {
        _pause();
    }

    function unpause() public onlyRole(PAUSER_ROLE) {
        _unpause();
    }

    function safeMint(address to) public onlyRole(MINTER_ROLE) {
        uint256 tokenId = _tokenIdCounter.current();
        _tokenIdCounter.increment();
        _safeMint(to, tokenId);
        emit MetaPassportMint(to, tokenId);
    }

    function _beforeTokenTransfer(address from, address to, uint256 tokenId)
        internal
        whenNotPaused
        override
    {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    // The following functions are overrides required by Solidity.

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721, AccessControl)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }

    // tokenURI

    function _baseURI() internal view virtual override returns (string memory) {
        return tokenURIPrefix;
    }

    function setTokenURIPrefix(string memory newTokenURIPrefix) public onlyRole(DEFAULT_ADMIN_ROLE) {
        tokenURIPrefix = newTokenURIPrefix;
    }

    // Each address can only have one MetaPassport

    function _transfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual override {
        require(balanceOf(to) > 0, "MetaPassport: Each address can only have one MetaPassport");
        super._transfer(from, to, tokenId);
        _owned[from] = 0x0;
        _owned[to] = tokenId;
    }

    function _mint(address to, uint256 tokenId) internal virtual override {
        require(balanceOf(to) <= 0, "MetaPassport: Each address can only have one MetaPassport");
        super._mint(to, tokenId);
        _owned[to] = tokenId;
    }

    function getMetaPassport(address addr) public view returns(uint256) {
        return _owned[addr];
    }

    // MetaPassport Avatar

    function setAvatarPartAddress(address newavatarPartAddress) public onlyRole(DEFAULT_ADMIN_ROLE) {
        avatarPartAddress = newavatarPartAddress;
    }

    function setAvatarSetAddress(address newAvatarSetAddress) public onlyRole(DEFAULT_ADMIN_ROLE) {
        avatarSetAddress = newAvatarSetAddress;
    }

    function setPartTypeCnt(uint newMax) public onlyRole(DEFAULT_ADMIN_ROLE) {
        partTypeCnt = newMax;
    }

    function bindAvatarPart(uint256 mpTokenId, uint256 avatarPartId) public {
        require((msg.sender == avatarSetAddress) || (msg.sender == avatarPartAddress), "MetaPassport: only avatar contract can call this function");

        if(isBindAvatarPart(mpTokenId, avatarPartId) == false) {
            _bindAvatarsMapping[mpTokenId][avatarPartId] = true;
            _bindAvatarsArray[mpTokenId].push(avatarPartId);
            emit BindAvatarPart(mpTokenId, avatarPartId);
        }
    }

    function checkFirstBindAvatar(uint256 mpTokenId, uint[] calldata partIds) public {
        require((msg.sender == avatarSetAddress), "MetaPassport: only avatar contract can call this function");
        // if not first bind, skip
        // type=0 is base, base is start from 1
        if(_selectedAvatar[mpTokenId][0] > 0) { 
            return;
        }
        require(partIds.length == partTypeCnt, "MetaPassport: invalid partId count");
        require(mpTokenId > 0, "MetaPassport: no metapassport");

        for(uint i=0; i<partTypeCnt; i++) {
            uint partId = partIds[i];
            require(isBindAvatarPart(mpTokenId, partId), "MetaPassport: part id is not bind");
            _selectedAvatar[mpTokenId][i] = partId;
        }

        emit SetCurrentAvatarPart(mpTokenId, partIds);
    }

    function getBindAvatarParts(uint256 mpTokenId) public view returns(uint256[] memory){
        return _bindAvatarsArray[mpTokenId];    
    }

    function isBindAvatarPart(uint256 mpTokenId, uint256 avatarPartId) public view returns(bool) {
        return _bindAvatarsMapping[mpTokenId][avatarPartId];
    }

    function setMyCurrentAvatar(uint[] memory partIds) public {
        require(partIds.length == partTypeCnt, "MetaPassport: invalid partId count");
        uint256 mpTokenId = getMetaPassport(msg.sender);
        require(mpTokenId > 0, "MetaPassport: no metapassport");

        for(uint i=0; i<partTypeCnt; i++) {
            uint partId = partIds[i];
            require(isBindAvatarPart(mpTokenId, partId), "MetaPassport: part id is not bind");
            _selectedAvatar[mpTokenId][i] = partId;
        }

        emit SetCurrentAvatarPart(mpTokenId, partIds);
    }

    function getMyCurrentAvatar() public view returns(uint[] memory) {
        uint256 mpTokenId = getMetaPassport(msg.sender);
        require(mpTokenId > 0, "MetaPassport: no metapassport");
        uint[] memory partIds = new uint[](partTypeCnt);
        for(uint i=0; i<partTypeCnt; i++) {
            uint partId = _selectedAvatar[mpTokenId][i];
            partIds[i] = partId;
        }
        return partIds;
    }
}
